import React from 'react';
import './App.css';

function Login() {
  return (
    <div>
      <h1>Sign in</h1>
      <p>Username</p>
      <input type="text"/>
      <p>Password</p>
      <input type="password"/>
      <button>Sign in</button>
    </div>
  );
}

export default Login;
